from  collections import defaultdict

class Solution(object):
    def hasGroupsSizeX(self, deck):
        if(len(deck)<=1):
            return False
        deck_count=defaultdict(int)

        for each in deck:
            deck_count[each]+=1

        mini=10000000
        for each in deck_count:
            if(deck_count[each]<mini):
                mini=deck_count[each]
        if(mini<2):
            return False
        hcf=0
        for each in deck_count:
            if(not hcf):
                hcf=self.findHCF(deck_count[each], mini)
                if(hcf==1):
                    return False
            else:
                p=self.findHCF(deck_count[each], mini)
                if(p==1):
                    return False
                if(p>=hcf and p%hcf!=0):
                    return False
                elif(p<=hcf and hcf%p!=0):
                    return False
        return True

    def findHCF(self, num1, num2):
        x=num1
        count=1
        while(num1%num2 != 0):
            num1=x*count
            count+=1
        t=(x*num2)/num1

        return (x*num2)/num1

